const { Hex } = require("../../utils")

class MG1CS002_AT{
    
    /**
     * @param {{ bd2?: Buffer, bd3?: Buffer }} blocksData 
     */
    static PatchBlocksData(blocksData){
        const { bd2, bd3 } = blocksData

        if(Buffer.isBuffer(bd2)){
            Hex("08FDB362400028740000000F").copy(bd2, 0x1E2C4)
            Hex("0A752060").copy(bd2, 0x1E2F0)
        }

        if(Buffer.isBuffer(bd3)){
            Hex("E8").copy(bd3, 0x3B0C)
            Hex("78015DE7").copy(bd3, 0x4F22)
            Hex("632040019A7000000138").copy(bd3, 0x1E2DE)
            Hex("").copy(bd3, 0x1E320)
        }

    }

}

module.exports = {
    MG1CS002_AT
}
